/*    ON THE BORDER - Bundled ACH 
This script can be used to create Posting plans and Settlement Plans for 
Bundled ACH  for "ON THE BORDER" merchants only.

For OTB , Pseudo merchant '454045100008956' is created , ACCT_POSTING_PLAN 13 is created,
SETTL_PLAN_ID (value created at run time). 

OTB Merchants who are assigned with the new plans (ACCT_POSTING_PLAN 13,
SETTL_PLAN_ID (value created at run time)) , will not receive ACH, instead it 
will be deposited in the Pseudo merchant '454045100008956' account. 
*/

DECLARE  
inst_id NUMBER;
new_entity_id NUMBER;
new_settl_plan_id NUMBER; 
var_tid_next_settl_date date;
BEGIN 
inst_id := '107';
new_entity_id := '454045100008956';--Pseudo merchant for ON THE BORDER

    --ACCT_PPLAN_MASTER - 13 for BUNDLED ,FEES AND DISPUTES
    VALUES ('107','13','G','BUNDLED ,FEES AND DISPUTES');

    --ACCT_POSTING_PLAN - 13 for BUNDLED ,FEES AND DISPUTES 
 
    --MODIFYING THE PIN_DEBIT TRX to be in Sale "A"
    UPDATE MASCLR.acct_posting_plan SET acct_posting_type='A' where acct_pplan_id=13 and card_sch_to_post='02' and acct_posting_type='D';
    
    -- USE ON PROD/QA ONLY
    SELECT 
    MAX(last_seq_nbr)+1 INTO new_settl_plan_id 
    FROM MASCLR.seq_ctrl where seq_name='settl_plan_id';

    --SETTL_PLAN
    VALUES (inst_id,new_settl_plan_id,new_entity_id,'G');
    --NEXT_SETTL_DATE
    select to_date(to_char(last_day(add_months( sysdate ,0) ),'DD-MON-YY') || ' 12:00:00 AM', 'DD-MON-YY HH:MI:SS AM') into 
    var_tid_next_settl_date  from dual;

    --SETTL_PLAN_TID
    --NEXT_SETTL_DATE
    UPDATE MASCLR.settl_plan_tid SET NEXT_SETTL_DATE = var_tid_next_settl_date 
    WHERE institution_id = inst_id AND SETTL_FREQ='M' AND SETTL_PLAN_ID = new_settl_plan_id;

   --ACQ_ENTITY - Update the Pseudo merchant with the new plans   
    UPDATE MASCLR.ACQ_ENTITY SET ACCT_PPLAN_ID=13, SETTL_PLAN_ID=new_settl_plan_id WHERE INSTITUTION_ID='107' AND ENTITY_ID='454045100008956'; 

    --UPDATE SEQ CTRL Table
    UPDATE MASCLR.seq_ctrl
    SET last_seq_nbr = new_settl_plan_id
    WHERE seq_name = 'settl_plan_id'
    AND institution_id = inst_id;

COMMIT;
END;